    [Parameter] public int LogoId { get; set; }
    [Parameter] public string LogoName { get; set; } 
    private Logos logos;

    
  

    protected async override Task OnInitializedAsync()
    {
      
        var httpResponse = await repo.Get<Logos>($"api/logos/{LogoId}");

        if (httpResponse.Error)
        {            
          await mostrar.MostrarMensajeError(await httpResponse.GetBody());            
        }
        else
        {
            logos = httpResponse.Response;
        }

    }

    private async Task HandleEdit()
    {
        var httpResponse = await repo.Put("api/logos", logos);

        if (httpResponse.Error)
        {
            await mostrar.MostrarMensajeError(await httpResponse.GetBody());
        }
        else
        {
            nm.NavigateTo("admin/logos");
        }
    }

   

